% The total Number of bytes of data collected for each index i
numberOfBytesCollectedPerI = 64*1099511627776/256;

% Ensure that the histograms contain all required data by supplementing them from each other where necessary
% Supplement histogram_ij255_id66 from the last columns of i0k and i255k
histogram_ij255_id66(:, 1) = histogram_i0k_id66(:, 256);
histogram_ij255_id66(:, 256) = histogram_i255k_id66(:, 256);

% Supplement histogramDefault from the previous three histograms
